ArrayClient client = new ArrayClient(credential);

using RequestContent content = RequestContent.Create(new object[]
{
    new object[]
    {
        "<arrayBody>"
    }
});
Response response = await client.PutArrayValidAsync(content);

Console.WriteLine(response.Status);

